import {StyleSheet , Dimensions} from 'react-native'

const windowHeight = Dimensions.get('window').height;

const stylesModal = StyleSheet.create({
    textConteiner:{
        height:'80%'
    },

    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
      },
      modalContainer: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
      },
      modalContent: {
        backgroundColor: 'white',
        padding: 20,
        width: '80%',
        alignItems: 'center',
      },

    modalButtonConteir:{
        display:'flex',
        flexDirection:'row'
    },

    modalButtons:{
        display:'flex',
        alignItems:'center',
        backgroundColor:'grey',
        borderWidth:1,
        width:'55%',
        height:windowHeight*0.07,
    },
    

});

export default stylesModal;
